        function typeWriter() {
          let sentences = document.querySelectorAll('.sentence');
          let characterCount = 0;

          for (let i = 0; i < sentences.length; i++) {
            let sentence = sentences[i];
            let newContent = '';

            // go through all characters of the sentence
            for (let j = 0; j < sentence.textContent.length; j++) {
              let substring = sentence.textContent.substr(j, 1);
              // if we have a character, wrap it
              if (substring !== " ") {
                newContent += `<span style="--animation-order: ${characterCount};">${substring}</span>`;
              } else {
                newContent += substring;
              }
              characterCount++;
            }
            sentence.innerHTML = newContent;
          }
        }
        var currentDate = new Date();
        var start_date = response.start_time;
        var current_date =  currentDate.getTime();
        var d1 = moment.tz(start_date, "Asia/Kolkata");
        var d2 = moment.tz(current_date, "Asia/Kolkata");
        if (d1 <= d2 ) {
          var dd = currentDate.getDate();
          var mm = currentDate.getMonth() + 1;
          var y = currentDate.getFullYear();
          var hr = currentDate.getHours();
          var min = currentDate.getMinutes();
          var sec = currentDate.getSeconds();

          var cdate = y + '/'+ mm + '/'+ dd + ' ' + hr + ':'+ min + ':' + sec;
        }else {
          cdate = start_date;
        }
        var end_date = response.end_time;
        if (response.bar_type == 'count_bar') {
          startClock(cdate,end_date);
        }
        function startClock(start_date,end_date){
          var clock;
          var targetDate = moment.tz(end_date, "Asia/Kolkata");
          var currentDateTime = moment.tz(start_date, "Asia/Kolkata");
          // Calculate the difference in seconds between the future and current date
          var diff = targetDate / 1000 - currentDateTime / 1000;
          if (diff <= 0) {
            // If remaining countdown is 0
            clock = $(".clock").FlipClock(0, {
              clockFace: "DailyCounter",
              countdown: true,
              autostart: false
            });
            // console.log("Date has already passed!")

          } else {
            // Run countdown timer
            clock = $(".clock").FlipClock(diff, {
              clockFace: "DailyCounter",
              countdown: true,
              callbacks: {
                stop: function() {
                  // console.log("Timer has ended!")
                  if (response.deleted == 0) {
                    $('.hideBar').fadeOut(600);
                  }
                }
              }
            });

            // Check when timer reaches 0, then stop at 0
            setTimeout(function() {
              checktime();
            }, 1000);

            function checktime() {
              t = clock.getTime();
              if (t <= 0) {
                clock.setTime(0);
              }
              setTimeout(function() {
                checktime();
              }, 1000);
            }
          }
        }
